import React from "react";
import Mask from "../../components/Mask";
import ResetSent from "../../assets/application-submitted.png"

const ResetPasswordConfrimed = () =>{
    return(
        <Mask title="Check Your Mail!!!">
                <img src={ResetSent} width="800"/>
                <span>
                    A link for the password reset has been sent to t
                </span>
                <button className="submit-btn r">
                    Finish
                </button>
        </Mask>
    )
}

export default ResetPasswordConfrimed;
